import React from 'react';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';

const ReceiptGenerator = () => {
  // SOURCE DATA FROM YOUR RECEIPT [cite: 2, 8, 10]
  const data = {
    // NOTE: Use a Base64 string here for your real logo to avoid download errors.
    logo: "data:image/jpeg;base64,", 
    studentPhoto: "data:image/jpeg;base64,",
    receiptNo: "KRJ-2026-001",
    studentId: "STU-1024",
    date: "01-Jan-2026",
    session: "2025-2026",
    name: "RAHUL KUMAR",
    guardian: "SANJAY SINGH",
    mobile: "+91 62022697900", // 
    class: "12th Standard",
    course: "JEE Foundation",
    batch: "Achievers Batch",
    timing: "04:00 PM - 07:00 PM",
    mode: "Offline Classroom",
    fees: [
      ["Admission Fee", "1,500.00"],
      ["Course Fee", "12,000.00"],
      ["Study Material", "2,500.00"],
      ["Total Fee", "16,000.00"],
      ["Paid Amount", "10,000.00"],
      ["Discount", "500.00"],
      ["Due Amount", "5,500.00"],
    ],
    paymentMode: "UPI / PhonePe"
  };

  const getBase64ImageFromURL = (url) => {
    return new Promise((resolve, reject) => {
      const img = new Image();
      img.setAttribute("crossOrigin", "anonymous");
      img.onload = () => {
        const canvas = document.createElement("canvas");
        canvas.width = img.width;
        canvas.height = img.height;
        const ctx = canvas.getContext("2d");
        ctx.drawImage(img, 0, 0);
        resolve(canvas.toDataURL("image/png"));
      };
      img.onerror = () => reject(new Error("Image Load Failed: " + url));
      img.src = url;
    });
  };

  const generatePDF = async () => {
    try {
      const doc = new jsPDF('p', 'mm', 'a4');
      const pageWidth = doc.internal.pageSize.getWidth();
      const pageHeight = doc.internal.pageSize.getHeight();

      // Download images before starting PDF generation
      let logoImg, photoImg;
      try {
        logoImg = await getBase64ImageFromURL(data.logo);
        photoImg = await getBase64ImageFromURL(data.studentPhoto);
      } catch (err) {
        console.warn("Using text placeholders because images failed to load.");
      }

      // --- 1. PREMIUM DESIGN BORDERS ---
      doc.setDrawColor(44, 62, 80);
      doc.setLineWidth(0.8);
      doc.rect(5, 5, pageWidth - 10, pageHeight - 10);
      doc.setLineWidth(0.2);
      doc.rect(6.5, 6.5, pageWidth - 13, pageHeight - 13);

      // --- 2. LOGO SECTION ---
      if (logoImg) {
        doc.addImage(logoImg, 'PNG', 12, 12, 28, 28);
      } else {
        doc.setFillColor(240);
        doc.rect(12, 12, 28, 28, 'F');
        doc.setFontSize(8);
        doc.text("LOGO", 26, 26, { align: "center" });
      }

      // --- 3. HEADER  ---
      doc.setTextColor(44, 62, 80);
      doc.setFont("helvetica", "bold");
      doc.setFontSize(20);
      doc.text("KNOWLEDGE RAISING JUNCTION", 45, 22);
      
      doc.setFontSize(9);
      doc.setFont("helvetica", "normal");
      doc.setTextColor(100);
      doc.text("Gobindpur, Tundi Road, Tundi, Dhanbad-828109, Jharkhand", 45, 28);
      doc.text("Ph: +91 62022697900 | Web: krj.com | Email: krj@gmail.com", 45, 33);

      // --- 4. PHOTO BOX ---
      doc.setDrawColor(180);
      doc.rect(pageWidth - 42, 12, 30, 35);
      if (photoImg) {
        doc.addImage(photoImg, 'PNG', pageWidth - 41, 13, 28, 33);
      }

      // --- 5. RECEIPT BANNER ---
      doc.setFillColor(44, 62, 80);
      doc.rect(12, 55, pageWidth - 24, 10, 'F');
      doc.setTextColor(255, 255, 255);
      doc.setFontSize(12);
      doc.text("FEE PAYMENT RECEIPT", pageWidth / 2, 61.5, { align: "center" });

      // --- 6. STUDENT INFO [cite: 8] ---
      autoTable(doc, {
        startY: 70,
        theme: 'grid',
        head: [['STUDENT DETAILS', '', 'COURSE DETAILS', '']],
        body: [
          ['Receipt No:', data.receiptNo, 'Student ID:', data.studentId],
          ['Student Name:', data.name, 'Class:', data.class],
          ['Father Name:', data.guardian, 'Course:', data.course],
          ['Mobile:', data.mobile, 'Timing:', data.timing],
        ],
        styles: { fontSize: 8.5, cellPadding: 3 },
        headStyles: { fillColor: [240, 240, 240], textColor: [44, 62, 80] },
      });

      // --- 7. PAYMENT DETAILS [cite: 10] ---
      autoTable(doc, {
        startY: doc.lastAutoTable.finalY + 10,
        theme: 'striped',
        head: [['Description', 'Amount (INR)']],
        body: data.fees,
        styles: { fontSize: 9.5 },
        headStyles: { fillColor: [44, 62, 80] },
        columnStyles: { 1: { halign: 'right', fontStyle: 'bold' } },
        foot: [['Payment Mode', data.paymentMode]],
        footStyles: { fillColor: [44, 62, 80], halign: 'right' }
      });

      // --- 8. FOOTER [cite: 11] ---
      const finalY = pageHeight - 25;
      doc.setTextColor(0);
      doc.setFontSize(10);
      doc.text("Authorized Signatory", pageWidth - 15, finalY, { align: "right" });
      doc.line(pageWidth - 60, finalY - 5, pageWidth - 15, finalY - 5);

      doc.setFontSize(8);
      doc.setFont("helvetica", "italic");
      doc.setTextColor(150);
      doc.text("Note: This is a computer-generated receipt and does not require a physical signature.", pageWidth / 2, pageHeight - 10, { align: "center" });

      doc.save(`Receipt_${data.name}.pdf`);
    } catch (error) {
      alert("PDF generation error: " + error.message);
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '100px', fontFamily: 'Arial' }}>
      <h1 style={{ color: '#2c3e50' }}>KRJ Receipt Generator</h1>
      <button 
        onClick={generatePDF} 
        style={{ padding: '15px 40px', fontSize: '18px', cursor: 'pointer', background: '#2c3e50', color: 'white', border: 'none', borderRadius: '8px' }}
      >
        Download Receipt 
      </button>
    </div>
  );
};

export default ReceiptGenerator;